import React from "react";
import Nav from './Nav'
import login_img from './img/login_img.jpeg';
import './Nav.css';
import './Home.css';


const home ={
    backgroundImage: 'url(' + login_img + ')',
    width: '100%',
    height: '100%',
    backgroundRepeat: 'no-repeat',
    backgroundSize: '100% 100%',
}

class Home extends React.Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
      <div style={home}>
          <Nav/>
            <div class="image">
                <a class="btn" href="/login"><span>Register/Login</span></a>
            </div>
            <div id="about">
                  <center><h1 class="contentHead">ABOUT..Pay It Forward</h1></center>



                    <p><img src={login_img} class="imageabout" alt="about"/><br/><br/><h2>
                          Hi Donor/Customer,<br/>
                        </h2></p>
                </div>



            <div id="contact">    


            </div>

      </div>
    );
  }
}


export default Home
